import PDFFIle from "../../../../common/PDFFile.js";

const TryThese = props => (
  <div className="box">
    <h1 className="title is-6">Exercises</h1>
    <p>Try these exercises taken from past papers.</p>

    <h1 className="title is-6">Easy</h1>
    <ul className="list-ul">
      <li>
        <PDFFIle title="Directed Sitautions Easy 1" />
      </li>
      <li>
        <PDFFIle title="Directed Sitautions Easy 2" />
      </li>
      <li>
        <PDFFIle title="Directed Sitautions Easy 3" />
      </li>
    </ul>

    <style>
      {`
      .list-ul {
        padding: 20px;
      }

      .list-ul li {
        padding-bottom: 10px;
      }
      `}
    </style>
  </div>
);

export default TryThese;
